  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains the 1996-era and
  2005-era classifications of US East Coast, zone 60 and zone 64 can be used to analyze
  change. This imagery was collected as part of the Multi-Resolution Land Characteristics
  program in a multi-agency effort to provide baseline multi-scale environmental characteristics
  and to monitor environmental change. This data set utilized 79 (zone 60) and 71
  (zone 64) full or partial Landsat 5 and 7 scenes which were analyzed according to
  the Coastal Change Analysis Program (C-CAP) protocol to determine land cover.\",\n\t\"owner_org\":
